<?php

use PHPMailer\PHPMailer\PHPMailer;
use PHPMailer\PHPMailer\SMTP;
use PHPMailer\PHPMailer\Exception;
use TCPDF;

require __DIR__ . '/../vendor/autoload.php';

function recupererDonnees()
{
    global $db;

    $req = $db->prepare("SELECT stagiaires.id, nom, prenom, nom_session, horaires_recues_1, horaires_recues_2, horaires_recues_3, attestation_mail_envoye, attestation_recue, evaluation_mail_envoye, evaluation_recue, compteur_demandes
                        FROM stagiaires
                        JOIN sessions ON sessions.id = stagiaires.id_session
                        JOIN stages ON stages.id = stagiaires.id_stage;");
    $req->execute();
    $donnees = $req->fetchAll(PDO::FETCH_ASSOC);
    return $donnees;
}

function envoyerMail($id_stagiaire, $documents, $document_libelles, $bEstRelance = false)
{
    global $db;

    //Récupération des données du stage
    $req = $db->prepare("SELECT nom, prenom, duree_stage, sigle, DATE_FORMAT(date_debut_stage, '%d/%m/%Y') AS date_debut, DATE_FORMAT(date_fin_stage, '%d/%m/%Y') AS date_fin, nom_tuteur, prenom_tuteur, mail_tuteur, compteur_demandes 
                        FROM stagiaires 
                        JOIN sessions ON sessions.id = stagiaires.id_session
                        LEFT JOIN stages ON stages.id = stagiaires.id_stage
                        WHERE stagiaires.id=:id_stagiaire;");
    $req->bindParam(":id_stagiaire", $id_stagiaire);
    $req->execute();
    $stage = $req->fetch(PDO::FETCH_ASSOC);

    //Create an instance; passing `true` enables exceptions
    $mail = new PHPMailer(true);

    try {
        //Server settings
        $mail->SMTPDebug = SMTP::DEBUG_SERVER;                      //Enable verbose debug output
        $mail->isSMTP();                                            //Send using SMTP
        $mail->CharSet    = "UTF-8";                                //Enable encoding in UTF-8
        $mail->Encoding   = 'base64';                               //Change the default encoding
        $mail->Host       = 'smtp.gmail.com';                       //Set the SMTP server to send through
        $mail->SMTPAuth   = true;                                   //Enable SMTP authentication
        $mail->Username   = 'marceau.ro@adrar-numerique.com';       //SMTP username
        $mail->Password   = 'pleoxdpptfpkdmnd';                     //SMTP password
        $mail->SMTPSecure = PHPMailer::ENCRYPTION_STARTTLS;         //Enable implicit TLS encryption
        $mail->Port       = 587;                                    //TCP port to connect to; use 587 if you have set `SMTPSecure = PHPMailer::ENCRYPTION_STARTTLS`

        //Recipients
        $mail->setFrom('marceaurodrigues@adrar-formation.com', 'Marceau RODRIGUES');
        $mail->addAddress($stage['mail_tuteur'], $stage['prenom_tuteur'] . " " . $stage['nom_tuteur']);
        // $mail->addAddress('marceau0707@gmail.com', $stage['prenom_tuteur'] . " " . $stage['nom_tuteur']);
        $mail->addReplyTo('marceaurodrigues@adrar-formation.com', 'Marceau RODRIGUES');
        // $mail->addCC('marceaurodrigues@adrar-formation.com');
        $mail->addBCC('marceaurodrigues@adrar-formation.com'); // Blind Carbon Copy

        //Création des PDFs personnalisés
        if (in_array("attestation", $documents)) {
            $html2pdf = new TCPDF('P', 'mm', 'A4', true, 'UTF-8');
            $html2pdf->SetCreator('Marceau RODRIGUES');
            $html2pdf->SetAuthor('Marceau RODRIGUES');
            $html2pdf->SetTitle('Attestation de stage');
            $html2pdf->SetSubject('Attestation de stage');
            $html2pdf->AddPage();
            $imgdata = base64_decode(''); // La template de l'attestation
            $html2pdf->Image('@' . $imgdata); // The '@' character is used to indicate that follows an image data stream and not an image file name

            // Positionnement des textes
            $html2pdf->setXY(55, 45);
            $html2pdf->Cell(0, 10, ucwords($stage['prenom']) . " " . strtoupper($stage['nom']), 0, 1);
            $html2pdf->setXY(94, 62);
            $html2pdf->Cell(0, 10, $stage['date_debut'], 0, 1);
            $html2pdf->setXY(94, 72);
            $html2pdf->Cell(0, 10, $stage['date_fin'], 0, 1);
            $html2pdf->setXY(49, 82);
            $html2pdf->Cell(0, 10, $stage['duree_stage'], 0, 1);
            $html2pdf->Output(__DIR__ . '/../v/tmp/attestation.pdf', 'F');
            $mail->addAttachment(__DIR__ . '/../v/tmp/attestation.pdf', 'Attestation_de_stage.pdf');
            $req = $db->prepare("UPDATE stagiaires 
                                SET attestation_mail_envoye = 1
                                WHERE id=:id_stagiaire;");
            $req->bindParam(":id_stagiaire", $id_stagiaire);
            $req->execute();
        }
        if (in_array("evaluation", $documents)) {
            $html2pdf = new TCPDF('P', 'mm', 'A4', true, 'UTF-8');
            $html2pdf->SetCreator('Marceau RODRIGUES');
            $html2pdf->SetAuthor('Marceau RODRIGUES');
            $html2pdf->SetTitle('Évaluation de stage');
            $html2pdf->SetSubject('Évaluation de stage');
            $html2pdf->AddPage();
            $imgdata = base64_decode(''); // La template de l'évaluation - Page 1
            $html2pdf->Image('@' . $imgdata);
            $html2pdf->setXY(32, 49);
            $html2pdf->Cell(0, 10, ucwords($stage['prenom']) . " " . strtoupper($stage['nom']), 0, 1);
            // $html2pdf->setXY(110, 49);
            // $html2pdf->Cell(0, 10, 'NOM Entreprise', 0, 1);
            $html2pdf->setXY(42, 56.5);
            $html2pdf->Cell(0, 10, $stage['sigle'], 0, 1);
            $html2pdf->setXY(127, 56.5);
            $html2pdf->Cell(0, 10, ucwords($stage['prenom_tuteur']) . " " . strtoupper($stage['nom_tuteur']), 0, 1);
            $html2pdf->setXY(56, 64.5);
            $html2pdf->Cell(0, 10, $stage['date_debut'], 0, 1);
            $html2pdf->setXY(92, 64.5);
            $html2pdf->Cell(0, 10, $stage['date_fin'], 0, 1);
            $html2pdf->setXY(147, 64.5);
            $html2pdf->Cell(0, 10, $stage['duree_stage'], 0, 1);
            $html2pdf->AddPage();
            $imgdata = base64_decode(''); // La template de l'évaluation - Page 2
            $html2pdf->Image('@' . $imgdata);
            $html2pdf->setXY(138, 185.5);
            $html2pdf->Cell(0, 10, 'Marceau RODRIGUES', 0, 1);
            $imgdata = base64_decode('');
            $html2pdf->Image('@' . $imgdata, 138, 187.5, 50, 30);
            $html2pdf->Output(__DIR__ . '/../v/tmp/evaluation.pdf', 'F');
            $mail->addAttachment(__DIR__ . '/../v/tmp/evaluation.pdf', 'Evaluation_de_stage.pdf');
            $req = $db->prepare("UPDATE stagiaires 
                                SET evaluation_mail_envoye = 1
                                WHERE id=:id_stagiaire;");
            $req->bindParam(":id_stagiaire", $id_stagiaire);
            $req->execute();
        }
        if (in_array("presence", $documents)) {
            $html2pdf = new TCPDF('P', 'mm', 'A4', true, 'UTF-8');
            $html2pdf->SetCreator('Marceau RODRIGUES');
            $html2pdf->SetAuthor('Marceau RODRIGUES');
            $html2pdf->SetTitle('État de présence - Heures en entreprise');
            $html2pdf->SetSubject('État de présence - Heures en entreprise');
            $html2pdf->AddPage();
            $imgdata = base64_decode(''); // La template de la feuille de présence
            $html2pdf->Image('@' . $imgdata);
            $html2pdf->setXY(113, 38);
            $html2pdf->Cell(0, 10, ucwords($stage['prenom']) . " " . strtoupper($stage['nom']), 0, 1);
            $html2pdf->setXY(50, 42.5);
            $html2pdf->Cell(0, 10, $stage['sigle'], 0, 1);
            $html2pdf->Output(__DIR__ . '/../v/tmp/presence.pdf', 'F');
            $mail->addAttachment(__DIR__ . '/../v/tmp/presence.pdf', 'Heures_en_entreprise.pdf');
        }

        $liste_documents = "";
        foreach ($document_libelles as $document) {
            $liste_documents .= "<li>" . $document . "</li>";
        }

        if ($bEstRelance) {
            $message = file_get_contents(__DIR__ . '/../v/templates_mails/MAIL_RELANCE.html');
            $message = strtr($message, array(
                '{{NB_RELANCE}}' => $stage['compteur_demandes'] + 1
            ));
        } else {
            $message = file_get_contents(__DIR__ . '/../v/templates_mails/MAIL_DEMANDE.html');
        }
        $message = strtr($message, array(
            '{{NOM_TUTEUR}}' => strtoupper($stage['nom_tuteur']),
            '{{PRENOM_NOM_STAGIAIRE}}' => ucwords($stage['prenom']) . " " . strtoupper($stage['nom']),
            '{{LISTE_DOCUMENTS}}' => $liste_documents,
        ));

        //Content
        $mail->isHTML(true);
        if ($bEstRelance) {
            $mail->Subject = 'Relance de demande des documents de stage';
        } else {
            $mail->Subject = 'Demande de documents de stage';
        }
        $mail->Body    = $message;
        $mail->AltBody = strip_tags($message);

        if($mail->send()) {
            $req = $db->prepare("UPDATE stagiaires 
                                SET compteur_demandes = compteur_demandes + 1
                                WHERE id=:id_stagiaire;");
            $req->bindParam(":id_stagiaire", $id_stagiaire);
            $req->execute();
        }
        echo "Message délivré.";
    } catch (Exception $e) {
        throw new Error("Message non délivré. Erreur: {$mail->ErrorInfo}");
    }
    return true;
}
